import React from 'react';

function PricingSection() {
  return (
    <section id="pricing" className="bg-white py-16">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl font-bold mb-8 text-center text-gray-900">Pricing</h2>
        <div className="text-center">
          <p className="text-xl font-semibold text-gray-800 mb-4">$79 one-time payment</p>
          <p className="text-gray-600">No subscriptions, just a single payment for lifetime access to the Directory Maker boilerplate.</p>
        </div>
      </div>
    </section>
  );
}

export default PricingSection;
